import {} from 'semantic-ui-react';

function Frame(props){
    const [show,setShow] = useState(props.gg);
    const setFalse =()=>{
        setShow(false);
    }

    const close =()=>{
        window.close();
    }
    if(show){
    return(
        <div>
        <iframe height="300px" width="100%" name="iframe_a" src={props.link}></iframe>
        <button onClick={()=>close}>hu</button>
        </div>
    )
}
}
export default Frame;
